	ClaimTransferSignRefunds(context.Context, *ClaimTransferSignRefundsRequest) (*ClaimTransferSignRefundsResponse, error)
	StorePreimageShare(context.Context, *StorePreimageShareRequest) (*emptypb.Empty, error)
